import { HeaderElements } from "./HeaderElements"

export const Header = ()=>{

    let sections = ['Logo', 'Количка', 'Начало', 'МЕНЮ', 'За нас']

    return (
        <section className="header">
            <nav className="navBar">
                <ul className='navUl'>
                    {sections.map(x => <HeaderElements name={x} />)}
                </ul>
            </nav>
        </section>
    )
}
